import React, { Component } from 'react';
import './Home.css';

class Content extends Component {

    render() {
        return (
            <div className="con" >   
                <div class="container-fluid" >
                    <div class="row" >

                        <div class="col-lg-3" >                   
                        </div>

                        <div class="col-lg-3" >
                        </div>

                        <div class="col-lg-5" >
                            <h2>Hello</h2>
                            <br/>
                        <br/>
                        </div>

                        <div class="col-lg-1" >
                        </div>





                    </div>
                    <div  class="row" >
                        <div class="col-lg-12" >
                        <a  href="/App" class="btn btn-primary btn-lg active" role="button" aria-pressed="true">เข้าสู่หน้าหลัก</a>
                            <br/>
                        <br/>
                        </div>
                    </div>
                </div>

                
            </div>



        );
    }
}
export default Content;
